window.bookSummaryJSON = "<p>Dying didn’t get rid of his heart.</p> <p>Grim Dating is a hit with the underworld and running like a smooth machine, which is why the commander and his mate decide to go on a vacation, leaving Julio in charge.</p> <p>It’s his chance to show the Dark Lord he’s got the sinning it takes to move up in the ranks. You won’t see him getting distracted from the job by a nice pair of legs or a fetching smile. Settling down is not in the tarot cards for Julio.</p> <p>Yet when an angel walks into the office asking how babies are made, he’s quick to volunteer. But seducing angels is not allowed.</p> <p>Will Heaven and Hell make an exception for love?</p>"; 
